import React from "react";


class Info extends React.Component{
    render(){
        if(!this.props.result) return null;
        return(
            <div className="info-card">
                <div className="main-title">
                    <h2>
                        {this.props.result[this.props.id]}
                    </h2>
                </div>
            </div>
        );
    }
}
export default Info;
